import styled from '@emotion/styled';

export const Div = styled.div`
  display: flex;
  margin: 20px;
  justify-content: flex-end;
`;

export const P = styled.p`
  font-weight: bold;
  font-size: 30px;
  margin: 0px;
  padding: 10px 0;
`;

export const Button = styled.button`
  background-color: #d0a686;
  height: 60px;
  width: 100px;
  border-radius: 15px;
  margin-left: 60px;
  font-size: 20px;
  margin-right: 20px;
  font-weight: bold;
  border: none;
`;
